// SE Ranking Keyword Research Data Formatter - FIXED v2
const allInput = $input.all();
const timestamp = new Date().toISOString().split('T')[0];

let output = [];

// Process each input item as a separate section
allInput.forEach((item, sectionIndex) => {
  const section = item.json;

  if (!section) {
    output.push({
      json: {
        date: timestamp,
        error: 'No data in item',
        section_index: sectionIndex
      }
    });
    return;
  }

  // Section type 1: Simple totals with keyword list (strings)
  if (section.total && Array.isArray(section.keywords) && typeof section.keywords[0] === 'string') {
    output.push({
      json: {
        date: timestamp,
        data_type: 'keyword_list_summary',
        section_index: sectionIndex,
        total_keywords: section.total,
        sample_keywords: section.keywords.slice(0, 5).join('; ')
      }
    });
  }

  // Section type 2: Detailed keywords with metrics (objects with history_trend)
  else if (section.total && Array.isArray(section.keywords) && 
           section.keywords[0]?.keyword && section.keywords[0]?.history_trend !== undefined) {
    // Summary record
    output.push({
      json: {
        date: timestamp,
        data_type: 'keyword_research_summary',
        section_index: sectionIndex,
        total_keywords: section.total,
        keywords_with_data: section.keywords.length
      }
    });

    // Individual keyword records
    section.keywords.forEach(kw => {
      output.push({
        json: {
          date: timestamp,
          data_type: 'keyword_detail',
          section_index: sectionIndex,
          keyword: kw.keyword,
          volume: kw.volume || 0,
          cpc: kw.cpc || 0,
          difficulty: kw.difficulty || 0,
          competition: kw.competition || 0,
          serp_features: kw.serp_features ? kw.serp_features.join('; ') : '',
          intents: kw.intents ? kw.intents.join('; ') : '',
          trend_avg: kw.history_trend ? 
            Math.round(Object.values(kw.history_trend).reduce((a, b) => a + b, 0) / Object.values(kw.history_trend).length) : 0,
          trend_data: kw.history_trend ? JSON.stringify(kw.history_trend) : null
        }
      });
    });
  }

  // Section type 3: Single keyword metrics
  else if (section.is_data_found !== undefined && section.keyword) {
    output.push({
      json: {
        date: timestamp,
        data_type: 'single_keyword_metrics',
        section_index: sectionIndex,
        keyword: section.keyword,
        volume: section.volume || 0,
        cpc: section.cpc || 0,
        difficulty: section.difficulty || 0,
        competition: section.competition || 0,
        is_data_found: section.is_data_found
      }
    });
  }

  // Section type 4: Related keywords with relevance (objects with relevance and no history_trend OR null history_trend)
  else if (section.total && Array.isArray(section.keywords) && 
           section.keywords[0]?.keyword && section.keywords[0]?.relevance !== undefined) {
    // Summary record
    output.push({
      json: {
        date: timestamp,
        data_type: 'related_keywords_summary',
        section_index: sectionIndex,
        total_keywords: section.total,
        keywords_analyzed: section.keywords.length
      }
    });

    // Individual related keyword records
    section.keywords.forEach(kw => {
      output.push({
        json: {
          date: timestamp,
          data_type: 'related_keyword',
          section_index: sectionIndex,
          keyword: kw.keyword,
          volume: kw.volume || 0,
          cpc: kw.cpc || 0,
          difficulty: kw.difficulty || 0,
          competition: kw.competition || 0,
          relevance: kw.relevance || 0,
          serp_features: kw.serp_features ? kw.serp_features.join('; ') : '',
          intents: kw.intents ? kw.intents.join('; ') : '',
          trend_avg: kw.history_trend ? 
            Math.round(Object.values(kw.history_trend).reduce((a, b) => a + b, 0) / Object.values(kw.history_trend).length) : 0,
          trend_min: kw.history_trend ? Math.min(...Object.values(kw.history_trend)) : 0,
          trend_max: kw.history_trend ? Math.max(...Object.values(kw.history_trend)) : 0
        }
      });
    });
  }

  // Unknown section type - debug info
  else {
    output.push({
      json: {
        date: timestamp,
        data_type: 'unknown_section',
        section_index: sectionIndex,
        has_total: !!section.total,
        has_keywords: !!section.keywords,
        keywords_is_array: Array.isArray(section.keywords),
        first_keyword_type: section.keywords?.[0] ? typeof section.keywords[0] : 'none',
        first_keyword_keys: section.keywords?.[0] && typeof section.keywords[0] === 'object' ? 
          Object.keys(section.keywords[0]).join('; ') : 'n/a',
        all_keys: Object.keys(section).join('; ')
      }
    });
  }
});

return output;
